INSERT INTO `micro-sd-64gb` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (11, '../img/products/Micro-SD-64GB/KEXIN Micro SD Karte 64GB.webp;', 'KEXIN Micro SD Karte 64GB', 'https://www.amazon.de/KEXIN-MicroSDXC-Speicherkarte-Smartphones-Sicherheitssystem/dp/B084R9W53H/ref=sr_1_3?__mk_de_DE=%C3%85M%C3%85%C5%BD%C3%95%C3%91&crid=2Q0GPOJQ7QRRJ&keywords=KEXIN+Micro+SD+Karte+64GB&qid=1667221807&qu=eyJxc2MiOiIwLjAwIiwicXNhIjoiMC4wMCIsInFzcCI6IjAuMDAifQ%3D%3D&sprefix=%2Caps%2C86&sr=8-3', '9,99', 4.5, 3102, 0, 'KEXIN;10 g;Nein;-;KEXIN;64 GB;[Weit Verbreitet] - Die KEXIN Micro SD Karte ist perfekt für Android-Smartphones, Tablets, Digitalkameras, Spielekonsolen, Dashcams, Drohnen, Fire-Tablets, Monitore und Überwachungssysteme usw.; Es kann verwendet werden, um hochauflösende Fotos, Videos, Dokumente, Musik und mehr zu speichern oder zu sichern.|[Hochgeschwindigkeits SD Karte] - Die TF Speicherkarte übernimmt die Geschwindigkeitsklasse UHS-I (U1) und Klasse 10 (C10) und bietet Ihnen eine Lesegeschwindigkeit von 80 MB/s und eine Schreibgeschwindigkeit von 20 MB/s und unterstützt Full-HD-Videoaufzeichnung . (Die Leistung kann je nach Hostgerät, Schnittstelle, Nutzungsbedingungen und anderen Faktoren variieren.)|[Auf Langlebigkeit Ausgelegt] - Die Speicherkarte Micro SD verwendet einen hochwertigen Chip, ist wasserabweisend, antimagnetisch, stoßfest, hoch- oder niedrigtemperaturbeständig und hält die Daten immer sicher.|[Micro SD Karte 64 gb] - Micro SD 64 GB, verfügbare Kapazität beträgt ca. 58,88 GB. Ideal als Geschenk zu Weihnachten, Geburtstag, Business, Abschluss.|[Freundlicher Hinweis] - Standardmäßig ist die 32 GB Microsd Karte als FAT32 formatiert, während 64 GB oder höher als exFAT formatiert sind. Die tatsächlich verfügbare Kapazität für die Datenspeicherung ist aufgrund von Formatierung und anderen Funktionen geringer als auf den Produkten angegeben. 1 GB = 1.000.000.000 Byte. (1 Jahr Garantie)');
