INSERT INTO `micro-sd-64gb` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (11, '../img/products/Micro-SD-64GB/KEXIN Micro SD Karte 64GB.webp;', 'KEXIN Micro SD Karte 64GB', 'https://www.amazon.de/KEXIN-MicroSDXC-Speicherkarte-Smartphones-Sicherheitssystem/dp/B084R9W53H/ref=sr_1_3?__mk_de_DE=%C3%85M%C3%85%C5%BD%C3%95%C3%91&crid=2VK9MQQ4SKAW4&keywords=KEXIN+Micro+SD+Karte+64GB&qid=1667645239&qu=eyJxc2MiOiIwLjAwIiwicXNhIjoiMC4wMCIsInFzcCI6IjAuMDAifQ%3D%3D&sprefix=%2Caps%2C90&sr=8-3', '9,99', 4.5, 3136, 0, 'KEXIN;10 g;Nein;-;KEXIN;64 GB;[Weit Verbreitet] - Die KEXIN Micro SD Karte ist perfekt für Android-Smartphones, Tablets, Digitalkameras, Spielekonsolen, Dashcams, Drohnen, Fire-Tablets, Monitore und Überwachungssysteme usw.; Es kann verwendet werden, um hochauflösende Fotos, Videos, Dokumente, Musik und mehr zu speichern oder zu sichern.|[Hochgeschwindigkeits SD Karte] - Die TF Speicherkarte übernimmt die Geschwindigkeitsklasse UHS-I (U1) und Klasse 10 (C10) und bietet Ihnen eine Lesegeschwindigkeit von 80 MB/s und eine Schreibgeschwindigkeit von 20 MB/s und unterstützt Full-HD-Videoaufzeichnung . (Die Leistung kann je nach Hostgerät, Schnittstelle, Nutzungsbedingungen und anderen Faktoren variieren.)|[Auf Langlebigkeit Ausgelegt] - Die Speicherkarte Micro SD verwendet einen hochwertigen Chip, ist wasserabweisend, antimagnetisch, stoßfest, hoch- oder niedrigtemperaturbeständig und hält die Daten immer sicher.|[Micro SD Karte 64 gb] - Micro SD 64 GB, verfügbare Kapazität beträgt ca. 58,88 GB. Ideal als Geschenk zu Weihnachten, Geburtstag, Business, Abschluss.|[Freundlicher Hinweis] - Standardmäßig ist die 32 GB Microsd Karte als FAT32 formatiert, während 64 GB oder höher als exFAT formatiert sind. Die tatsächlich verfügbare Kapazität für die Datenspeicherung ist aufgrund von Formatierung und anderen Funktionen geringer als auf den Produkten angegeben. 1 GB = 1.000.000.000 Byte. (1 Jahr Garantie)');
INSERT INTO `micro-sd-64gb` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (12, '../img/products/Micro-SD-64GB/Verbatim Premium U1.webp;', 'Verbatim Premium U1', 'https://www.amazon.de/Verbatim-43962-SecureDigital-Class-SDHC-Karte/dp/B0050OFBWI/ref=sr_1_3?__mk_de_DE=%C3%85M%C3%85%C5%BD%C3%95%C3%91&crid=2ZF1LCCIJ5CFC&keywords=Verbatim+Premium+U1&qid=1667645250&qu=eyJxc2MiOiIwLjk3IiwicXNhIjoiMC4wMCIsInFzcCI6IjAuMDAifQ%3D%3D&sprefix=%2Caps%2C125&sr=8-3', '8,49', 4.5, 991, 0, 'Verbatim;-;-;SDHC;-;-;16 GB;OPTIMALE AUFLÖSUNG: Die Speicherkarte überzeugt dank Leistungsklasse 10 mit einer Datenübertragsrate von mind. 80 Mbit/s - sie ermöglicht es Ihnen, Full-HD-Videos aufzunehmen.|SCHNELLE ÜBERTRAGUNG: Mit der SD-Karte profitieren Sie von sehr kurzen Übertragungszeiten Ihrer Dateien - dank einer Lesegeschwindigkeit von bis zu 80 MB/s &amp; Schreibgeschwindigkeit von mind. 10 MB/s.|VIELSEITIGE EINSATZGEBIETE: Die SDHC-Speicherkarte ist mit jedem elektronischen Gerät bspw. PC &amp; Kamera kompatibel, dass einen Einschub für die SDHC/SDXC-Speicherkarte besitzt.|PRODUKTDETAILS: Die Speicherkarte von Verbatim ist in den Ausführungen 16 GB , 32 GB , 64 GB, 128 GB und 256 GB erhältlich - sie ist kompatibel mit Kameras &amp; Hostgeräten, die SDXC unterstützen.|Verbatim: Mit unserer jahrelangen Erfahrung stehen wir für genaue &amp; fehlerfreie Datenspeicherung - Unsere Stärken in den Bereichen F&amp;E und Qualitätssicherung garantieren erstklassige Produkte!');
